import React, { Component } from 'react'

export class Header extends Component {
    render() {
        return (
            <div class="header">
                <a href="#default" class="logo">Loan Management System</a>
                <div class="header-right">
                    <a class="active" href="#home">Home</a>
                    <a class="button" href="#contact">Register</a>
                    <a class="button" href="#about">Login</a>
                </div>
            </div>
        )
    }
}

export default Header
